import React from 'react';
import './../stylesheets/Marker.css';

const Marker = (props: any) => {
    const { color, name} = props;
    return (
      <div>
        <div
          className="pin bounce"
          style={{ backgroundColor: color, cursor: 'pointer' }}
          title={name}
        />
        <div className="pulse" />
      </div>
    );
  };

  export default Marker;
